sys_variable_value.value:
(function execute(inputs, outputs) {

    // ... code ...
    if(inputs.status_code=='200'){
        var response = JSON.parse(inputs.response_body);

        outputs.hostname = response.hostname;
        outputs.city = response.city;
        outputs.region = response.region;
        outputs.country = response.country;


        var locArray = response.loc.split(",");
        outputs.latitude = locArray[0];
        outputs.longitude = locArray[1];

    }


})(inputs, outputs);

